S1UMessageBroker::S1UMessageBroker(int intfid, int rId) {
	_thisLogLevel = 0;
	this->_name = "S1UMessageBroker";
	this->setLogLevel(Log::theLog().level());

	this->interfaceId = intfid;
	this->routerId = rId;
}

S1UMessageBroker::~S1UMessageBroker()
{ }

VOID S1UMessageBroker::store_S1U_Packet(MPacket *msgObj)
{
	int smId = -1;

	switch(msgObj->ipAppProtocol)
	{
			case PACKET_IPPROTO_TCP:
					switch(msgObj->ipVer)
					{
						case IPVersion4:
							if(msgObj->sourceIpAddrLong > 0 && msgObj->destIpAddrLong > 0)
							{
									if(msgObj->dirUserNetwork == 1)
										smId = msgObj->sourceIpAddrLong % IPGlobal::S1U_SESSION_MANAGER_INSTANCES;
									else if(msgObj->dirUserNetwork == 2)
										smId = msgObj->destIpAddrLong % IPGlobal::S1U_SESSION_MANAGER_INSTANCES;
							}
							break;

						default:
							return;
							break;
					}

					pushMessageToQueue(smId, msgObj);
					break;

			case PACKET_IPPROTO_UDP:
					switch(msgObj->dnsQRFlag) /* To prevent all DNS traffic for Ipv6 to goto single SM as it is port based distribution */
					{
						case QUERY:
						case RESPONSE:
								smId = msgObj->dnsTransactionId % IPGlobal::S1U_SESSION_MANAGER_INSTANCES;
							break;

						default:
							switch(msgObj->ipVer)
							{
								case IPVersion4:
									if(msgObj->sourceIpAddrLong > 0 && msgObj->destIpAddrLong > 0)
									{
											if(msgObj->dirUserNetwork == 1)
												smId = msgObj->sourceIpAddrLong % IPGlobal::S1U_SESSION_MANAGER_INSTANCES;
											else if(msgObj->dirUserNetwork == 2)
												smId = msgObj->destIpAddrLong % IPGlobal::S1U_SESSION_MANAGER_INSTANCES;
									}
									break;

								default:
									return;
									break;
							}
							break;
					}

					pushMessageToQueue(smId, msgObj);
					break;

				default:
					break;
	}
}

VOID S1UMessageBroker::pushMessageToQueue(int smid, MPacket *msgObj)
{
	int idx = PKT_WRITE_TIME_INDEX(IPGlobal::CURRENT_EPOCH_SEC, IPGlobal::PKT_TIME_INDEX);

	switch(this->interfaceId)
	{
		case 0:
			pushMessageToQueue_i_0(smid, idx, msgObj);
			break;
		case 1:
			pushMessageToQueue_i_1(smid, idx, msgObj);
			break;
		case 2:
			pushMessageToQueue_i_2(smid, idx, msgObj);
			break;
		case 3:
			pushMessageToQueue_i_3(smid, idx, msgObj);
			break;
		case 4:
			pushMessageToQueue_i_4(smid, idx, msgObj);
			break;
		case 5:
			pushMessageToQueue_i_5(smid, idx, msgObj);
			break;
		case 6:
			pushMessageToQueue_i_6(smid, idx, msgObj);
			break;
		case 7:
			pushMessageToQueue_i_7(smid, idx, msgObj);
			break;
	}
}

